import './user_info.css';

function UserInfo() {
    return (
        <>
            <header className="App-header">
                <p>
                Edit <code>src/App.js</code> sheep.
                </p>
                <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
                >
                Learn React
                </a>
            </header>
        </>
    );
}

export default UserInfo;
